import MenuButtons from './MenuButtons';

const Menu = () => {

    return (
        <div id="menu-container">
            <input id="cat-name" type="text" placeholder="Enter Kitten Name" maxLength="12"/>
            <MenuButtons></MenuButtons>
            <img id="cat-info-background" src="/imgs/Notebook Menu.png" draggable="false" alt=""/>
        </div>
    );
};
export default Menu;
